const RealizedStudies = () => (
    <div className = "container-studies">
        <h1> Estudios Realizados </h1>
        <div className="studies-information">
            <h2>Ingenier√≠a de Sistema (No culminado)</h2>
            <span>2012 - 2016</span>
            <span>Barcelona - Venezuela</span>
            <span><b></b>Universidad de Oriente</span>
        </div>


        <style jsx > { `
                .container-studies{
                    border: 1px solid blue;
                    margin-right: 70px;
                    margin-top: 20px;
                }
                .studies-information{
                    display:grid;
                    grid-template-columns: repeat(340px, 1fr);
                }
                ` }
        </style>
    </div>
);

export default RealizedStudies;
